import React, { useEffect } from "react";

const ImagesresH = () => {

useEffect(()=>{
    fetch(`https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&q=yellow+flowers&image_type=photo&pretty=true`)
    .then(res=>res.json())
    .then(imgdata=>{
        console.log(imgdata)
    })
})




  return (
    <>
      <div className="ImagesresH-box">

      </div>
    </>
  );
};

export default ImagesresH;
